     * To select a different value for {decimals}, use {_setupDecimals}.
     *
     * All three of these values are immutable: they can only be set once during
     * construction.
     */
    constructor (string memory name_, string memory symbol_,uint8 decimals_,address owner_, uint totalSupply_)  {
        _name = name_;
        _symbol = symbol_;
        _decimals = decimals_;

        _beforeTokenTransfer(address(0), owner_, totalSupply_);

        _totalSupply = _totalSupply.add(totalSupply_);
        _balances[owner_] = _balances[owner_].add(totalSupply_);
    }

    /**
